%pyspark

fd_cct = get_freq_dist_spdf(days[1])

for day in days[2:]:
    try:
        fd = get_freq_dist_spdf(day)
        fd_cct = fd_cct.join(fd, 'cct_group', 'full')
    except ValueError:
        continue

fd_cct = fd_cct.sort('cct_group').fillna(0).cache()

%pyspark
df_result = result.select('date', 'prediction').groupby('prediction').agg(functions.collect_set('date').alias('date')).sort('prediction')
list_result = list(map(lambda s: [s['prediction'], s['date']], df_result.collect()))

for cluster in list_result:
    counter = 0
    for day in cluster[1]:
        if day in clean_days:
            counter += 1
    print('>> clean days in group', str(cluster[0]), ':', str(counter), '/', str(len(cluster[1])))

%pyspark
import seaborn as sns
for day in list_result[0][1]:
    try:
        sns.distplot(get_daily_cct_(df_nt, day, 'spdf')\
           .sort('date', 'time').select('cct').toPandas())
    except ValueError:
        continue

